import Profile from "./components/profile/Profile";
import user from "./data/user.json";

function App() {
  return (
    <div>
      <Profile
        avatar={user.avatar}
        name={user.username}
        tag={user.tag}
        location={user.location}
        stats={user.stats}
      />
    </div>
  );
}

export default App;
